import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';
import Avatar from 'react-avatar';
import '../cssfile/Login.css';
import avatar from '../image.png';
function Buttons(){
    return(
    <div className='contain' style={{
        marginLeft:'300px'
    }}>
    <div className="card" style={{
            width: '60%',
            height:'60%',
            backgroundColor:'grey'
    }}>
    <h5 className="card-title">Click!!!</h5>
    <div className="card-body">
    <div className="avatar">
        <Avatar src={avatar} round={true} size="100"/>
        </div>
        <Button type="submit"className="btn-lg" id="button1">Delete Account!!</Button>
        <Button type="submit"className="btn-lg" id="button2">Change Password</Button>
    </div>
    </div>
    </div>
    );
}
export default Buttons;
